import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const AccountNav = styled.div`
	min-height: 35px;
	width: 100%;
	background-color: #dedede;
	display: flex;
	justify-content: flex-end;
	align-items: center;
`;

const JoinUs = styled.p`
	margin: 0;
	margin-right: 10px;
	font-size: 0.8rem;
	height: 100%;
	&:hover {
		color: #595959;
	}
`;

const SignIn = styled.p`
	margin: 0px 20px 0px 10px;
	font-size: 0.8rem;
	height: 100%;
	&:hover {
		color: #595959;
	}
`;

function Nav() {
    return (
		<>
			<nav className="navbar navbar-expand-lg navbar-light">
				<div className="container-fluid min-vh-7">
					<Link to='/' style={{ textDecoration: 'none' }}>
						<p className="navbar-brand mb-0">NikeShoes</p>
					</Link>
					<button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
					<span className="navbar-toggler-icon"></span>
					</button>
					<div className="collapse navbar-collapse " id="navbarSupportedContent">
						<ul className="d-flex navbar-nav me-auto nav-links-margins">
							<Link to='/' style={{ textDecoration: 'none' }}>
								<li className="nav-item">
									<p className="nav-link nav-links-margins" aria-current="page" >Home</p>
								</li>
							</Link>
							<Link to='/shop' style={{ textDecoration: 'none' }}>
								<li className="nav-item">
									<p className="nav-link nav-links-margins" >Shop</p>
								</li>
							</Link>
							<li className="nav-item dropdown">
							<p className="nav-link dropdown-toggle nav-links-margins"  id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
								Dropdown
							</p>
								<ul className="dropdown-menu" aria-labelledby="navbarDropdown">
									<li><p className="dropdown-item" >Shoes</p></li>
									<li><p className="dropdown-item" >Another action</p></li>
									<li><hr className="dropdown-divider"/></li>
									<li><p className="dropdown-item" >Something else here</p></li>
								</ul>
							</li>
						</ul>
						<form className="d-flex">
							<input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
							<button className="btn btn-outline-danger" type="submit">Search</button>
						</form>
					</div>
				</div>
			</nav>
			<AccountNav>
				<Link
					style={{textDecoration: 'none', color: 'black', height: '100%'}}
				><JoinUs>Join Us</JoinUs></Link>
				|
				<Link
					style={{textDecoration: 'none', color: 'black'}}
				><SignIn>Sign In</SignIn></Link>
			</AccountNav>
		</>
    );
}

export default Nav;
